  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Layout />} />
        <Route path='login' element={<LoginPage />} />
        <Route path='home' element={<LandingPage />}/>
      </Routes>
    </BrowserRouter>
  );
}


